import React from "react";
import DeleteOutlineIcon from "@material-ui/icons//DeleteOutline";
import EditIcon from "@material-ui/icons//Edit";

const Note = (props) => {
  // console.log(props);
  const deleteEvent = () => {
    props.deleData(props.id);
  };
  const editEvent = () => {};
  return (
    <>
      <div className="note">
        <h1>{props.title}</h1>
        <br />
        <p>{props.content}</p>
        <button className="btn" onClick={deleteEvent}>
          <DeleteOutlineIcon className="deleteIcon" />
        </button>
        <button className="btn" onClick={editEvent}>
          <EditIcon />
        </button>
      </div>
    </>
  );
};

export default Note;
